(1, 3, 1, '7608ac15dc12572.92671062', 'What is Lorem Ipsum?', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', 'Matilde Friesen', '2021-04-28', '2021-04-28', '21:00:00', '22:45:00', NULL, 1, 0, 1, 1, 1, NULL, 1, 'http://localhost/o/7608999157595f7.99963756', 'http://localhost/e/7608ac15dc12572.92671062', NULL, '2021-04-28 16:45:06', '2021-06-01 12:14:34'),
(6, 3, 1, NULL, '1914 translation by H. Rackham', 'On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pains.', 'Matilde Friesen', '2021-04-29', '2021-04-29', '12:00:00', '00:00:00', NULL, 1, 1, 1, 0, 1, NULL, 1, 'http://localhost/o/7608999157595f7.99963756', 'http://localhost/e/', NULL, '2021-04-30 07:27:53', '2021-04-30 13:10:29'),
